CREATE TABLE crud_user
(
    id INT(10) unsigned PRIMARY KEY NOT NULL AUTO_INCREMENT,
    name VARCHAR(20),
    age TINYINT(3) unsigned,
    email VARCHAR(100),
    head MEDIUMBLOB,
    head_url VARCHAR(100),
    birthday DATE,
    salary DECIMAL(10,2),
    gmt_create DATETIME,
    gmt_modified DATETIME,
    is_active CHAR(1),
    role_id INT(10) unsigned
);




